import React from 'react';
import {
  AppBar,
  Toolbar,
  Typography
  } from '@material-ui/core';

function Dashboard(){
  return(
    <AppBar color="primary">
      <Toolbar>
        <Typography>Demo App</Typography>
      </Toolbar>
    </AppBar>
  );
};

export default Dashboard;
